import React from "react";
import sizeMe, { SizeMe } from "react-sizeme";

function Background({ size }) {
  const { width } = size.bounds;

  if (size.width < 800) {
    return;

    <div>Tall</div>;
  } else {
    return;
    <div>Short</div>;
  }
}

export default sizeMe()(Background);
